import Link from "next/link"

const Navigation = ({ children }) => {
    return children
}

const Item = ({ children, href }) => {
    return (
        <Link href={href}>
            <span style={{
                // backgroundColor: 'red'
                cursor: 'pointer'
            }}>{children}</span>
        </Link>
    )
}

export {
    Item
}

export default Navigation
